server <- function(input, output, session){

  patterns <- reactiveValues()

  lapply(modules, function(module) {
    do.call(get(paste0(module, "_module_server")),
            args = list(module, patterns, reactive(input$module)))
  })

  # randomise when a new pattern is selected
  observeEvent(input$module, {
    runjs(glue("document.getElementById('{input$module}-random').click();"))
  })

  gallery_module_server("gallery")
  about_module_server("about")
  sparkle_module_server("sparkle")

  # send to UI
  output$svgout <- renderUI({
    patterns[[input$module]]
  })

  # store the current pattern and then click the actual download button
  observeEvent(input$download, {
    runjs("
      var elements = document.getElementsByTagName('svg')[0];
      var svgHTML = new XMLSerializer().serializeToString(elements);
      Shiny.setInputValue('svg', svgHTML, {priority: 'event', raw: true});
      setTimeout(function() {
        document.getElementById('download_h').click();
      }, 1000);
    ")
  })

  output$download_h <- downloadHandler(
    filename = function(){
      glue("{input$module}_{substr(Sys.time(), 1, 19)}.svg")
    },
    content = function(file){
      req(input$svg)
      write(input$svg, file)
    }
  )

}

shinyApp(ui, server)

random_color <- function(count = 1,
                         hue = c(" ", "random", "red", "orange", "yellow",
                                 "green", "blue", "purple", "pink", "monochrome"),
                         luminosity = c(" ", "random", "light", "bright", "dark")) {

  # Argument matching
  hue <- match.arg(hue)
  luminosity <- match.arg(luminosity)

  # Handle defaults/empty strings
  if (hue == " ") hue <- "random"
  if (luminosity == " ") luminosity <- "random"

  # Generate requested number of colors
  colors <- replicate(count, {
    # Handle random hue selection
    current_hue <- if (hue == "random") {
      sample(c("red", "orange", "yellow", "green", "blue", "purple", "pink", "monochrome"), 1)
    } else {
      hue
    }

    # Handle random luminosity selection
    current_luminosity <- if (luminosity == "random") {
      sample(c("light", "bright", "dark"), 1)
    } else {
      luminosity
    }

    # Generate the actual color
    generate_single_color(current_hue, current_luminosity)
  })

  return(colors)
}

# Helper function to generate a single color
generate_single_color <- function(hue, luminosity) {
  if (hue == "monochrome") {
    s <- 0
    h <- 0
  } else {
    s <- runif(1, 0.5, 1)
    h <- switch(hue,
                "red" = 0,
                "orange" = 30,
                "yellow" = 60,
                "green" = 120,
                "blue" = 240,
                "purple" = 270,
                "pink" = 330,
                runif(1, 0, 360)) # for "random" or invalid hue
  }

  l <- switch(luminosity,
              "bright" = runif(1, 0.5, 0.8),
              "light" = runif(1, 0.7, 0.9),
              "dark" = runif(1, 0.1, 0.4),
              runif(1, 0.1, 0.9)) # fallback for invalid luminosity

  rgb_col <- hcl(h, s * 100, l * 100)
  return(rgb_col)
}

